   FOR FILA IN (SELECT LPAD(NVL(emp.B00_NUM_RUC,0),11,'0') || TO_CHAR(SYSDATE, 'YYYYMMDD') || TO_CHAR(SYSDATE, 'MMDDHHMISS') || LPAD(NVL(tar.B05_ID_TAR,0),6,'0') || RPAD(NVL(TRIM(cli.B06_APPATERNO)||' '||TRIM(cli.B06_APMATERNO),' '),30,' ') || RPAD(NVL(cli.B06_NOMBRES,' '),30,' ') || NVL(cli.B06_TIPO_DOCUMENTO,0) || LPAD(NVL(cli.B06_NUM_DOCUMENTO,0),12,'0') || RPAD(NVL(TO_CHAR(cli.B06_FEC_NACIMIENTO, 'YYYYMMDD'),' '),8,' ') || NVL(cli.B06_SEXO,' ') || NVL(cli.B06_EST_CIVIL,' ') || NVL(cli.B06_DIRECCION_MC,LPAD(' ',35,' ')||LPAD('0',6,'0')||LPAD(' ',66,' ')) || LPAD(NVL(cli.B06_UBIGEO,0), 9,'0') || RPAD(NVL(cli.B06_REFERENCIA,' '),55,' ') || LPAD(NVL(cli.B06_TELEF_CASA,0),10,'0') || LPAD(NVL(tar.B05_NUM_CELULAR,0),10,'0') || RPAD(NVL(tar.B05_EMAIL,' '),30,' ') || RPAD('0',9,'0') || RPAD(NVL(emp.B00_NOMBRE_CORTO,' '),30,' ') || LPAD(NVL(emp.B00_NUM_RUC,0),11,'0') || NVL(emp.B00_DIRECCION_MC,LPAD(' ',35,' ')||LPAD('0',6,'0')||LPAD(' ',66,' ')) || LPAD(NVL(emp.B00_UBIGEO,0), 9,'0') || RPAD(NVL(emp.B00_REFERENCIA,' '),55,' ') || RPAD('0',10,'0') || NVL(tar.B05_ENTREGA_UBICACION,'0') || LPAD(NVL(tar.B05_ENTREGA_AGENCIA_BN,'0'),11,'0') || NVL(tar.B05_ENTREGA_DIRECCION_MC,LPAD(' ',35,' ')||LPAD('0',6,'0')||LPAD(' ',66,' ')) || LPAD(NVL(tar.B05_ENTREGA_UBIGEO,0), 9,'0') || RPAD(NVL(tar.B05_ENTREGA_REFERENCIA,' '),55,' ') || LPAD(NVL(tar.B05_TIPO_MONEDA,0), 3,'0') || '31' || LPAD(NVL(tar.B05_TIPO_TARJETA,0), 6,'0') || 'STD' || '3' || 'N' || 'D' || LPAD(NVL(emp.B00_NUM_CUENTA_CORRIENTE,0),17,'0') || LPAD(0,5,0) || LPAD(0,5,0) || 'T' || LPAD(' ',5,' ') || LPAD(NVL(tar.B05_DISENO,0), 1,'0') as TRAMA, tar.B05_ID_TAR as ID_TARJETA
FROM BN_SATE.BNSATE05_TARJETA tar 
JOIN BN_SATE.BNSATE06_CLIENTE cli ON tar.B06_ID_CLI = cli.B06_ID_CLI 
JOIN BN_SATE.BNSATE00_EMPRESA emp ON tar.B00_ID_EMP=emp.B00_ID_EMP 
JOIN BN_SATE.BNSATE07_EST_TARJETA eta ON eta.B05_ID_TAR = tar.B05_ID_TAR 
INNER JOIN (SELECT tar1.B05_ID_TAR, MAX(eta1.B07_FEC_REGISTRO) B07_FEC_REGISTRO FROM BN_SATE.BNSATE05_TARJETA tar1
JOIN BNSATE07_EST_TARJETA eta1 ON eta1.B05_ID_TAR = tar1.B05_ID_TAR 
GROUP BY tar1.B05_ID_TAR) q ON tar.B05_ID_TAR = q.B05_ID_TAR AND eta.B07_FEC_REGISTRO = q.B07_FEC_REGISTRO 
WHERE eta.B07_ESTADO = 2) LOOP
   dbms_output.put_line(FILA.TRAMA);
   END LOOP;
END BNPD_00_SOLICITUD_GEN_1;

